import React, { Component } from 'react';
import axios from "axios";
import './App.css';
import Header from "./component/header";
import uuid from "uuid";
import {BrowserRouter as Router,Route} from "react-router-dom";
import learn from "./component/pages/learn";
import Contact from "./component/pages/contact";
import { Container, Row , Col } from "reactstrap";
import {Jumbotron} from "reactstrap";




class App extends Component {




  render(){
    return(
      <Router>
          <div className="App">
          <header className="App-header">
            <Route exact path="/" render={props=>(
              <React.Fragment>
                <Header />
                <Container className='arabic  Container'>
                  <h1>: مدرستي</h1>
                  <p>  موقع لتعليم  المراحل الدراسية الابتدائية والاعداديه 
                      للغة العربية بكل  فروعها <br></br>
                      مثل: القراءة , النصوص , والنحو</p>
                      <br/>
              <br/>
              <br/>
              <br/>
                      <h1>
                        من نحن ؟
                      </h1>

                      <p>  نحن بعض المدرسين الذين قرروا انهم يصممون موقع 
مع بعض الخبراء لتوفير المعلومات الازمه للمارحل الدراسيه 
ونحن نضع هذه المعلومات ليس لربح مادي فقط لكي يستفيد 
الأطفال
              </p>
              <br/>
              <br/>
              <br/>
              <br/>



              <p>  
              نحن نوفر عليك معاناة المراجعة وكثرة الدروس ونوفر جميع الأسئلة 
التي تحتاجها من جميع المصادر الموثق بها لتوصيل طفلك إلي 
مستوى متميز

ونوفر لك كل الدروس على حسب السنة الدراسية للطفل وسوف تجد
 أسئلة كثيرة لنفس الدرس 


و يوجد مدرسين للتحدث معهم و الاستفسار إذا واجهتك مشكلة في درس معين 

سوف يشرحون لك الدرس و يطبقون لك بالأسئلة 


              </p>
                </Container>


              </React.Fragment>
            )}></Route>
            <Route path="/learn" component={learn}></Route>
            <Route path="/contact" component={Contact}></Route>

          </header>
         </div>
     </Router>

    );
  }
}

export default App;
